// RemoveSalaryStatements relationships from objects passed in.
// Removes related items from R.SalaryStatements (uses pointer comparison, removal does not keep order)
// Sets related.R.FixedEarning.
func (o *FixedEarning) RemoveSalaryStatements(ctx context.Context, exec boil.ContextExecutor, related ...*SalaryStatement) error {
	if len(related) == 0 {
		return nil
	}

	var err error
	for _, rel := range related {
		queries.SetScanner(&rel.FixedEarningID, nil)
		if rel.R != nil {
			rel.R.FixedEarning = nil
		}
		if _, err = rel.Update(ctx, exec, boil.Whitelist("fixed_earning_id")); err != nil {
			return err
		}
	}
	if o.R == nil {
		return nil
	}

	for _, rel := range related {
		for i, ri := range o.R.SalaryStatements {
			if rel != ri {
				continue
			}

			ln := len(o.R.SalaryStatements)
			if ln > 1 && i < ln-1 {
				o.R.SalaryStatements[i] = o.R.SalaryStatements[ln-1]
			}
			o.R.SalaryStatements = o.R.SalaryStatements[:ln-1]
			break
		}
	}

	return nil
}

